import {useForm} from "react-hook-form"

const Login=()=>{

    const{register,handleSubmit,formState:{errors}}=useForm();

    const SubmitForm=(data)=>{
        console.log(data)
    }

    return(
        <>
        <div>
            <form action="" onSubmit={handleSubmit(SubmitForm)}>
                <input className={`border-2 px-3 py-2 ${errors.username && 'border-red-400'}`} type="text" {...register("username",{required:{message:"Enter Username",value:true}})}/>
                <input type="password" {...register("password",{required:{message:"Enter Password",value:true}})}/>
                <input type="submit" value="Login" />
            </form>
        </div>
        </>
    )
}


export default Login;
